Привет. Меня зовут Александр Усачёв.
Я ведущий праздников, по совместительству организатор и режиссёр!
Иногда так хочется вырваться из будничной рутины и хорошенько повеселиться, правда?
В этом и заключается моя профессия: «Сделать ваш досуг ярким, весёлым и незабываемым!»
Уже более 7 лет  провожу праздники. Прошёл полное боевое крещение от аниматора до организатора мероприятий.
На моём счету более 500 мероприятий:
• Фестивали;
• Конкурсы;
• Детские и взрослые дни рождения;
• Корпоративы;
• Концерты;
• Открытия заведений;
• Творческие вечера;
• Благотворительные акции;
• Конференции;
• Импровизации.
По образованию я  режиссёр мероприятий и театра. Участвовал как режиссёр (2 спектакля и 7 постановок)  и актёр (12 ролей) в разных театральных и культурных проектах.
Сейчас активно развиваюсь, в новых, для себя, направлениях мероприятий: 
• Свадьбы;
• Корпоративы;
• Юбилеи;
• Дни Рождения;
Моя цель – «Превратить Ваш отдых в отдых»
Позвонив мне вы:
• Получите полезные советы, об организации праздника абсолютно бесплатно;
• Понимание ваших ожиданий и запросов: Вы хотите – я делаю;
• Содействие в решении всех проблем и вопросов связанных с организацией торжества (как и чем развлекать гостей? какой формат мероприятия выбрать? кого пригласить? как сделать праздник интересным? и т.д.);
• Одобрение друзей, близких, начальства, коллег по поводу организации и проведения мероприятия;
• Отсутствие затрат времени на поиск диджея, фотографа, декоратора, видеографа и т.д. – честно порекомендую лучших;
• Качество, честность и полный драйв)))
